import React, { useState } from 'react';
import { ChevronDown, ChevronRight, CheckCircle, XCircle, Clock, Play, AlertCircle } from 'lucide-react';

// 定义节点处理数据的类型
interface NodeProcessingData {
  status: string;
  startTime: string;
  endTime: string;
  duration: string;
  result: string;
  details: string;
  outputSize: string;
}

interface FileProcessingData {
  fileId: string;
  fileName: string;
  fileType: string;
  fileSize: string;
  overallStatus: string;
  currentNode: string;
  nodeProcessing: { [key: string]: NodeProcessingData };
}

const ExecutionDetails: React.FC = () => {
  const [expandedFiles, setExpandedFiles] = useState<string[]>([]);
  const [viewMode, setViewMode] = useState<'file' | 'node'>('file');

  // 工作流节点定义
  const workflowNodes = ['解析节点', '清洗节点', '增强节点'];

  // 文件处理数据 - 以文件为维度
  const fileProcessingData: FileProcessingData[] = [
    {
      fileId: 'file-1',
      fileName: '通过评分网-1.jpg',
      fileType: 'jpg',
      fileSize: '2.3MB',
      overallStatus: 'completed',
      currentNode: '增强节点',
      nodeProcessing: {
        '解析节点': {
          status: 'completed',
          startTime: '2024-08-19 14:50:01',
          endTime: '2024-08-19 14:50:15',
          duration: '14s',
          result: '解析成功，提取了图片元数据',
          details: '检测到人脸3个，物体12个',
          outputSize: '2.3MB'
        },
        '清洗节点': {
          status: 'completed',
          startTime: '2024-08-19 14:50:15',
          endTime: '2024-08-19 14:50:45',
          duration: '30s',
          result: '数据清洗完成',
          details: '移除了噪声，标准化了格式',
          outputSize: '2.1MB'
        },
        '增强节点': {
          status: 'completed',
          startTime: '2024-08-19 14:50:45',
          endTime: '2024-08-19 14:51:00',
          duration: '15s',
          result: '增强处理完成',
          details: '应用了色彩增强和锐化滤镜',
          outputSize: '2.4MB'
        }
      }
    },
    {
      fileId: 'file-2',
      fileName: '通过评分网-2.docx',
      fileType: 'docx',
      fileSize: '1.5MB',
      overallStatus: 'processing',
      currentNode: '清洗节点',
      nodeProcessing: {
        '解析节点': {
          status: 'completed',
          startTime: '2024-08-19 14:50:01',
          endTime: '2024-08-19 14:50:30',
          duration: '29s',
          result: '解析成功，提取了文本内容',
          details: '提取了5页内容，包含2个表格',
          outputSize: '1.2MB'
        },
        '清洗节点': {
          status: 'processing',
          startTime: '2024-08-19 14:50:30',
          endTime: '-',
          duration: '进行中(2分30秒)',
          result: '正在进行数据清洗...',
          details: '已处理60%，正在去除格式标记',
          outputSize: '-'
        },
        '增强节点': {
          status: 'pending',
          startTime: '-',
          endTime: '-',
          duration: '-',
          result: '等待清洗完成',
          details: '待开始',
          outputSize: '-'
        }
      }
    },
    {
      fileId: 'file-3',
      fileName: '通过评分网-3.txt',
      fileType: 'txt',
      fileSize: '800KB',
      overallStatus: 'failed',
      currentNode: '解析节点',
      nodeProcessing: {
        '解析节点': {
          status: 'failed',
          startTime: '2024-08-19 14:50:01',
          endTime: '2024-08-19 14:50:05',
          duration: '4s',
          result: '解析失败',
          details: '文件编码错误，无法读取内容',
          outputSize: '-'
        },
        '清洗节点': {
          status: 'skipped',
          startTime: '-',
          endTime: '-',
          duration: '-',
          result: '跳过处理',
          details: '由于上一节点失败而跳过',
          outputSize: '-'
        },
        '增强节点': {
          status: 'skipped',
          startTime: '-',
          endTime: '-',
          duration: '-',
          result: '跳过处理',
          details: '由于上一节点失败而跳过',
          outputSize: '-'
        }
      }
    },
    {
      fileId: 'file-4',
      fileName: '通过评分网-4.pdf',
      fileType: 'pdf',
      fileSize: '5.2MB',
      overallStatus: 'pending',
      currentNode: '解析节点',
      nodeProcessing: {
        '解析节点': {
          status: 'pending',
          startTime: '-',
          endTime: '-',
          duration: '-',
          result: '等待处理',
          details: '排队中...',
          outputSize: '-'
        },
        '清洗节点': {
          status: 'pending',
          startTime: '-',
          endTime: '-',
          duration: '-',
          result: '等待上一节点完成',
          details: '待开始',
          outputSize: '-'
        },
        '增强节点': {
          status: 'pending',
          startTime: '-',
          endTime: '-',
          duration: '-',
          result: '等待上一节点完成',
          details: '待开始',
          outputSize: '-'
        }
      }
    }
  ];

  const toggleFileExpansion = (fileId: string) => {
    setExpandedFiles(prev => 
      prev.includes(fileId) 
        ? prev.filter(id => id !== fileId)
        : [...prev, fileId]
    );
  };

  const getStatusIcon = (status: string) => {
    switch (status) {
      case 'completed': return <CheckCircle className="w-4 h-4 text-green-600" />;
      case 'processing': return <Play className="w-4 h-4 text-blue-600" />;
      case 'failed': return <XCircle className="w-4 h-4 text-red-600" />;
      case 'pending': return <Clock className="w-4 h-4 text-gray-400" />;
      case 'skipped': return <AlertCircle className="w-4 h-4 text-orange-500" />;
      default: return <Clock className="w-4 h-4 text-gray-400" />;
    }
  };

  const getStatusColor = (status: string) => {
    switch (status) {
      case 'completed': return 'text-green-600 bg-green-50';
      case 'processing': return 'text-blue-600 bg-blue-50';
      case 'failed': return 'text-red-600 bg-red-50';
      case 'pending': return 'text-gray-600 bg-gray-50';
      case 'skipped': return 'text-orange-600 bg-orange-50';
      default: return 'text-gray-600 bg-gray-50';
    }
  };

  const getStatusText = (status: string) => {
    switch (status) {
      case 'completed': return '已完成';
      case 'processing': return '处理中';
      case 'failed': return '失败';
      case 'pending': return '等待中';
      case 'skipped': return '已跳过';
      default: return '未知';
    }
  };

  const getFileStatusSummary = () => {
    const completed = fileProcessingData.filter(f => f.overallStatus === 'completed').length;
    const processing = fileProcessingData.filter(f => f.overallStatus === 'processing').length;
    const failed = fileProcessingData.filter(f => f.overallStatus === 'failed').length;
    const pending = fileProcessingData.filter(f => f.overallStatus === 'pending').length;

    return { completed, processing, failed, pending, total: fileProcessingData.length };
  };

  const summary = getFileStatusSummary();

  return (
    <div className="bg-white rounded-lg border border-gray-200 p-6 space-y-6">
      <div className="flex items-center justify-between">
        <h2 className="text-lg font-semibold text-gray-900">执行详情</h2>
        <div className="flex items-center space-x-2">
          <button
            onClick={() => setViewMode('file')}
            className={`px-3 py-1 text-sm rounded ${
              viewMode === 'file' 
                ? 'bg-blue-100 text-blue-700' 
                : 'text-gray-600 hover:bg-gray-100'
            }`}
          >
            文件视图
          </button>
          <button
            onClick={() => setViewMode('node')}
            className={`px-3 py-1 text-sm rounded ${
              viewMode === 'node' 
                ? 'bg-blue-100 text-blue-700' 
                : 'text-gray-600 hover:bg-gray-100'
            }`}
          >
            节点视图
          </button>
        </div>
      </div>

      {/* 文件处理概览 */}
      <div className="bg-gray-50 rounded-lg p-4">
        <h3 className="text-sm font-medium text-gray-700 mb-2">处理概览</h3>
        <div className="grid grid-cols-5 gap-4 text-sm">
          <div className="text-center">
            <div className="text-lg font-semibold text-gray-900">{summary.total}</div>
            <div className="text-gray-600">总文件数</div>
          </div>
          <div className="text-center">
            <div className="text-lg font-semibold text-green-600">{summary.completed}</div>
            <div className="text-gray-600">已完成</div>
          </div>
          <div className="text-center">
            <div className="text-lg font-semibold text-blue-600">{summary.processing}</div>
            <div className="text-gray-600">处理中</div>
          </div>
          <div className="text-center">
            <div className="text-lg font-semibold text-red-600">{summary.failed}</div>
            <div className="text-gray-600">失败</div>
          </div>
          <div className="text-center">
            <div className="text-lg font-semibold text-gray-600">{summary.pending}</div>
            <div className="text-gray-600">等待中</div>
          </div>
        </div>
      </div>

      {/* 文件处理详情 */}
      <div className="space-y-3">
        <h3 className="text-md font-medium text-gray-900">文件处理历程</h3>

        {fileProcessingData.map((file) => {
          const isExpanded = expandedFiles.includes(file.fileId);

          return (
            <div key={file.fileId} className="border border-gray-200 rounded-lg">
              <div 
                className="p-4 cursor-pointer hover:bg-gray-50"
                onClick={() => toggleFileExpansion(file.fileId)}
              >
                <div className="flex items-center justify-between">
                  <div className="flex items-center space-x-3">
                    {getStatusIcon(file.overallStatus)}
                    <div>
                      <h4 className="font-medium text-gray-900">{file.fileName}</h4>
                      <p className="text-sm text-gray-600">
                        {file.fileType.toUpperCase()} • {file.fileSize} • 当前: {file.currentNode}
                      </p>
                    </div>
                  </div>

                  <div className="flex items-center space-x-3">
                    <span className={`px-2 py-1 text-xs font-medium rounded-full ${getStatusColor(file.overallStatus)}`}>
                      {getStatusText(file.overallStatus)}
                    </span>
                    {isExpanded ? (
                      <ChevronDown className="w-5 h-5 text-gray-400" />
                    ) : (
                      <ChevronRight className="w-5 h-5 text-gray-400" />
                    )}
                  </div>
                </div>
              </div>

              {isExpanded && (
                <div className="border-t border-gray-200 p-4 bg-gray-50">
                  <div className="space-y-4">
                    <h5 className="font-medium text-gray-900">节点处理历程</h5>

                    {workflowNodes.map((nodeName, index) => {
                      const nodeData = file.nodeProcessing[nodeName];

                      return (
                        <div key={nodeName} className="flex items-start space-x-4">
                          <div className="flex flex-col items-center">
                            {getStatusIcon(nodeData.status)}
                            {index < workflowNodes.length - 1 && (
                              <div className="w-px h-8 bg-gray-300 mt-2"></div>
                            )}
                          </div>

                          <div className="flex-1 min-w-0">
                            <div className="flex items-center justify-between">
                              <h6 className="font-medium text-gray-900">{nodeName}</h6>
                              <span className={`px-2 py-1 text-xs font-medium rounded ${getStatusColor(nodeData.status)}`}>
                                {getStatusText(nodeData.status)}
                              </span>
                            </div>

                            <div className="mt-2 grid grid-cols-2 gap-4 text-sm text-gray-600">
                              <div>
                                <span className="font-medium">处理结果:</span>
                                <span className="ml-1">{nodeData.result}</span>
                              </div>
                              <div>
                                <span className="font-medium">耗时:</span>
                                <span className="ml-1">{nodeData.duration}</span>
                              </div>
                              <div>
                                <span className="font-medium">详情:</span>
                                <span className="ml-1">{nodeData.details}</span>
                              </div>
                              <div>
                                <span className="font-medium">输出大小:</span>
                                <span className="ml-1">{nodeData.outputSize}</span>
                              </div>
                            </div>

                            {nodeData.startTime !== '-' && (
                              <div className="mt-2 text-xs text-gray-500">
                                {nodeData.startTime} ~ {nodeData.endTime}
                              </div>
                            )}
                          </div>
                        </div>
                      );
                    })}
                  </div>
                </div>
              )}
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default ExecutionDetails;
